script:
const size = 24;
const origin = { x: -12, y: 1, z: -12 };
const center = size * 0.5 - 0.5;
const simplex = new SimplexNoise(Math.random());

reset();

for (let x = 0; x < size; x += 1) {
  for (let y = 1; y < size; y += 1) {
    for (let z = 0; z < size; z += 1) {
      const d = Math.sqrt((x - center) ** 2 + (z - center) ** 2);
      if (d * 2 < (y >= size * 0.5 ? size - y : y)) {
        update(
          origin.x + x, origin.y + y, origin.z + z,
          1
        );
      }
    }
  }
}

for (let i = 0; i < 4; i += 1) {
  const d = 5;
  const angle = (i + 0.5) * Math.PI / 2;
  cylinder(
    origin.x + size * 0.5 - 0.5 + Math.cos(angle) * d,
    origin.y + 1,
    origin.z + size * 0.5 - 0.5 + Math.sin(angle) * d,
    'y', 2, 5,
    1
  );
  cylinder(
    origin.x + size * 0.5 - 0.5 + Math.cos(angle) * d,
    origin.y + 1,
    origin.z + size * 0.5 - 0.5 + Math.sin(angle) * d,
    'y', 1, 1,
    0
  );
   cylinder(
    origin.x + size * 0.5 - 0.5 + Math.cos(angle) * d,
    origin.y + 5,
    origin.z + size * 0.5 - 0.5 + Math.sin(angle) * d,
    'y', 1, 1,
    0
  );
}

cylinder(
  origin.x + size * 0.5 - 0.5,
  origin.y,
  origin.z + size * 0.5 - 0.5,
  'y', 3, 6,
  1
);
cylinder(
  origin.x + size * 0.5 - 0.5,
  origin.y,
  origin.z + size * 0.5 - 0.5,
  'y', 2, size - 6,
  (x, y, z) => y === origin.y ? 2 : 0
);
box(
  origin.x + size * 0.5 - 1,
  origin.y + 1,
  origin.z + size * 0.5 + 2,
  2, 8, 2,
  0
);

box(
  origin.x + size * 0.5 - 3,
  origin.y + 5,
  origin.z + size * 0.5 - 1,
  1, 4, 2,
  2
);
box(
  origin.x + size * 0.5 - 4,
  origin.y + 8,
  origin.z + size * 0.5 - 1,
  1, 1, 2,
  0
);
box(
  origin.x + size * 0.5 + 2,
  origin.y + 5,
  origin.z + size * 0.5 - 1,
  1, 4, 2,
  2
);
box(
  origin.x + size * 0.5 + 3,
  origin.y + 8,
  origin.z + size * 0.5 - 1,
  1, 1, 2,
  0
);


box(
  origin.x + size * 0.5 - 1,
  origin.y + 6,
  origin.z + size * 0.5 - 3,
  2, 2, 1,
  0
);
box(
  origin.x + size * 0.5 - 1,
  origin.y + 6,
  origin.z + size * 0.5 - 4,
  2, 2, 1,
  1
);
box(
  origin.x + size * 0.5 - 2,
  origin.y + 1,
  origin.z + size * 0.5 - 4,
  4, 5, 1,
  1
);
